import React from 'react'

function PersonDetail(props) {
  return (
    <div> PersonDetail :
      <ul>
        <li>{props.person.nom}  </li>
        <li>{props.person.profession}</li>
      </ul>
       
    </div>
    
  )
}

export default PersonDetail
